'use strict';

module.exports = {
    expressFun: function expressFun() {

        var modalSearch = $('#modal-search');
        var modalResult = $('#modal-result');

        $('.search-tracking').click(function () {
            var tracking = $(this).data('tracking');
            var express = $(this).data('express');

            modalSearch.modal();

            $.ajax({
                type: 'get',
                url: '/order/express/query/' + tracking + '/' + express
            }).then(function (data) {

                var template = '';
                if (data.list) {
                    for (var i = 0; i < data.list.length; i++) {
                        var last = i === data.list.length - 1 ? 'color-timeline-item-last' : '';
                        var color = i === 0 ? 'green' : 'blue';
                        template += '\n                            <li class="color-timeline-item ' + last + '">\n                                <div class="color-timeline-item-tail"></div>\n                                <div class="color-timeline-item-head color-timeline-item-head-' + color + '"></div>\n                                <div class="color-timeline-item-content"><strong>' + data.list[i].time + '</strong> ' + data.list[i].status + '</div>\n                            </li>\n                        ';
                    }
                } else {
                    template = '\n                        <li class="color-timeline-item color-timeline-item-last">\n                            <div class="color-timeline-item-tail"></div>\n                            <div class="color-timeline-item-head color-timeline-item-head-red"></div>\n                            <div class="color-timeline-item-content">' + data.msg + '</div>\n                        </li>\n                    ';
                }
                modalSearch.modal('close');

                modalResult.find('ul').html(template);
                modalResult.modal();
            }, function (error) {
                modalSearch.modal('close');
                modalResult.find('ul').html(error);
                modalResult.modal();
            });
        });
    }
};

