    //获取手机验证号
    getSmsCode: function getSmsCode(mobile) {

        var getSmsCode = $('.get-smscode');
        var getLink = getSmsCode.find('a');
        var time = getSmsCode.find('em');
        var times = time.find('b');

        getLink.click(function () {

            var mobileValue = $.trim(mobile.val());

            if (!mobileValue) {
                mobile[0].focus();
                return false;
            }

            if (!/^1[0-9]{10}$/.test(mobileValue)) {
                $('.error-mobile').text('请输入正确的手机号码');
                mobile[0].focus();
                return false;
            }

            if (mobile.hasClass('valid')) {
                $.ajax({
                    type: 'get',
                    url: '/user/login/get-smscode/' + mobileValue
                }).done(function (data) {
                    if (data.success) {
                        (function () {
                            var count = 59;
                            times.text(count);
                            getSmsCode.addClass('on');
                            var interval = setInterval(function () {
                                count--;
                                times.text(count);
                                if (count === 0) {
                                    clearInterval(interval);
                                    getSmsCode.removeClass('on');
                                }
                            }, 1000);
                        })();
                    } else {
                        getSmsCode.parents('.am-form-group').next().html('请求超时,请稍后再试!');
                    }
                });
            }
        });
    }
